import { ContentBox } from "components/Common/Conteners/ContentContainer";
import React from "react";

export const Login = () => {
  return (
    <ContentBox
      margin={12}
      padding="19px"
      horizontalArrangement="start"
      verticalArrangement="start"
      // fullWidth
      // fullHeight
      style={{ backgroundColor: "#a0a0a0" }}>
      <div>Hello</div>
      <ContentBox
        horizontalArrangement="start"
        // verticalArrangement="center"
        fullWidth
        // fullHeight
        style={{ backgroundColor: "#f5f5f5" }}>
        <div>Content Box</div>
      </ContentBox>
      <div>Login</div>
    </ContentBox>
  );
};
